import React, {useState} from 'react';
import {Form, Container, Row, Col} from 'react-bootstrap';

function FotoKeluarga(){
	
	const [coba, setCoba] = useState({
    food: "gyoza"
  });

	const tambah = (e) => {
		const name = e.target.name;
    const value = e.target.value;

    setCoba(prev => ({
      ...prev,
      [name]: value
    }));
	}

	return(
		<>
		<center>
		<Container>
			<br />
			<br />
			<br />
			<br />
			<br />
			<Row>
				<Col>
				<Form.Label>Tampil Ga nih</Form.Label>
				<Form.Select aria-label="Default Select Example" onChange={tambah}>
				<option>Coba Tampil Ga nih....</option>
				<option value="testing1">Miko</option>
				<option value="testing2">Aki</option>
				</Form.Select>
				</Col>
			</Row>
			<Row>
				<Col>

				</Col>
			</Row>
			<Row>
				<Col>
					 
				</Col>
			</Row>
						<br />
			<br />
			<br />
			<br />
			<br />
			<Row>
				<Col>
				{coba}
				</Col>
			</Row>
		</Container>
		</center>
		</>
		);
}

export default FotoKeluarga;
